        const dispatch = useDispatch()
        useEffect(() => {
            dispatch(fetchUsers())
        }, [])

        return (
        <div>
            <h1>Profile</h1>
            {user.loading && <div>Loading...</div>}
            {!user.loading && user.error ? <div>Error: {user.error}</div> : null}
                <ul>

                </ul>
        </div>
    )}

